import React, { useState } from 'react'

const Registration = () => {
    const [Name, setname] = useState('');
    const submit = async () => {
        console.log("submit email!")
        this.props.history.push("/ResetLogin", { state: 'sample data' });
    }
    return (

        <div>
                    <input
                        type="text"
                        name="Name"
                        placeholder={'userName'}
                        value={Name}
                        onChange={(emil) => setname(emil.target.value)}
                    />
                <input type="submit" value="Submit" />
        </div>
    )
}

export default Registration
